import styles from "RosterCard.module.scss"

export default function RosterCard(){
    return(
        <div className="rosterCard">
            <div className="rosterProfile">
                <div className={styles.rosterPic}></div>
                <div className={styles.rosterName}>
                    <h3>Orange Beanie</h3>
                </div>
            </div>
        </div>
    )
}
